import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import ReactDom from 'react-dom';
import SideMenu from '../TanteAdmin/Components/SideMenu';

import '../TanteAdmin/Components/SideMenu';
import {
  CssBaseline,
  makeStyles,
  createMuiTheme,
  ThemeProvider,
} from '@material-ui/core';
import Header from '../TanteAdmin/Components/Header';

import Employees from '../TanteAdmin/Pages/Employees/Employees';

const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#2B3053',
      light: '#3c44b126',
    },
    secondary: {
      main: '#f83245',
      light: '#f8324526',
    },
    background: {
      default: '#f4f5fd',
    },
  },
  overrides: {
    MuiAppBar: {
      root: {
        transform: 'translateZ(0)',
      },
    },
  },
  props: {
    MuiIconButton: {
      disableRipple: true,
    },
  },
  shape: {
    borderRadius: '5px',
  },
});

const useStyles = makeStyles({
  appMain: {
    paddingLeft: '320px',
    width: '100%',
    marginTop: '100px',
    height: '100vh',
  },
});
function AdminScreen() {
  const classes = useStyles();
  const contentAdmin = (
    <ThemeProvider theme={theme}>
      <React.Fragment>
        <SideMenu />
        <div className={classes.appMain}>
          <Router>
            <Route path='/admin'>
              <Header />

              <Employees />
            </Route>
          </Router>
        </div>

        <CssBaseline />
      </React.Fragment>
    </ThemeProvider>
  );
  return ReactDom.createPortal(
    contentAdmin,
    document.getElementById('admin-page')
  );
}

export default AdminScreen;
